import './App.css';
import {
  // BrowserRouter as Router,
  Route,
  Switch,
  // Redirect
  // useRouteMatch,
  // useParams
} from "react-router-dom";

import Home from './components/home';
import Dashboard from './components/admin/dashboard';
import Login from './components/admin/login';
import FrontendLogin from './components/login';
import Register from './components/register';
import useToken from './components/admin/useToken';
import DoctorList from './components/doctors';
import DoctorsList from './components/admin/doctor-list';
import DoctorDetail from './components/doctor-detail';
import MyAppointments from './components/my-appointments';
import BookAppointment from './components/book-appointment';
import Prescription from './components/book-appointment';



function App() {

  const { token, setToken } = useToken();

  return (
    <div className="App">

      <Switch>

        {/*  Admin Panel Routes */}

        <Route path="/admin" exact>
          <Login setToken={setToken} />
        </Route>

        <Route path="/doctors-list" exact>
          <DoctorsList/>
        </Route>

        <Route path="/dashboard">
          <Dashboard />
        </Route>


        {/*  Frontend Routes */}

        <Route path="/" exact>
          <Home />
        </Route>

        <Route path="/login" exact>
          <FrontendLogin setToken={setToken} />
        </Route>

        <Route path="/register" exact>
          <Register/>
        </Route>

        <Route path="/doctors" exact>
          <DoctorList/>
        </Route>

        <Route path="/doctor-detail" exact>
          <DoctorDetail/>
        </Route>

        <Route path="/my-appointments" exact>
          <MyAppointments/>
        </Route>

        <Route path="/book-appointment" exact>
          <BookAppointment/>
        </Route>


      </Switch>

    </div>
  );
}

export default App;
